import * as React from 'react';
import * as styled from 'styled-components';

interface MenuItem {
  key: string;
  label: string;
}

const MenuItems: MenuItem[] = [
  {
    key: 'aboutMe',
    label: 'About me'
  },
  {
    key: 'projects',
    label: 'Projects'
  }
];
const StyledMenuItem = styled.span`
  .layout-header-menu-items {
    line-height: 32px;
    font-family: 'Sofia Pro Bold', 'Sofia Pro', Serif;
    font-style: italic;
    color: @main-color;
  }
`;
const LayoutHeader: React.FC<{}> = () => {
  return (
    <div className={'layout-Header'}>
      {MenuItems.map(item => (
        <StyledMenuItem key={item.key} className={'layout-header-menu-items'}>
          {item.label}
        </StyledMenuItem>
      ))}
    </div>
  );
};

export default LayoutHeader;
